];

const categories = [
  'All',
  'Crop Residue',
  'Animal Waste',
  'Food Processing Waste',
  'Forestry Waste',
  'Biomass',
];

const locations = [
  'All',
  'Ludhiana, Punjab',
  'Pune, Maharashtra',
  'Kochi, Kerala',
  'Gurgaon, Haryana',
  'Ahmedabad, Gujarat',
  'Vijayawada, Andhra Pradesh',
  'Jaipur, Rajasthan',
  'Kolkata, West Bengal',
  'Indore, Madhya Pradesh',
  'Bangalore, Karnataka',
];

const MarketplacePage = () => {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));
  const navigate = useNavigate();
  const location = useLocation();

  const [selectedCategory, setSelectedCategory] = useState('All');
  const [selectedLocation, setSelectedLocation] = useState('All');
  const [priceRange, setPriceRange] = useState([800, 2500]);
  const [searchQuery, setSearchQuery] = useState('');
  const [mobileFiltersOpen, setMobileFiltersOpen] = useState(false);

  const handleCategoryChange = (event) => {
    setSelectedCategory(event.target.value);
  };

  const handleLocationChange = (event) => {
    setSelectedLocation(event.target.value);
  };

  const handlePriceChange = (event, newValue) => {
    setPriceRange(newValue);
  };

  const handleSearchChange = (event) => {
    setSearchQuery(event.target.value);
  };

  const handleClearFilters = () => {
    setSelectedCategory('All');
    setSelectedLocation('All');
    setPriceRange([800, 2500]);
    setSearchQuery('');
  };

  const filteredProducts = mockProducts.filter((product) => {
    const matchesCategory = selectedCategory === 'All' || product.category === selectedCategory;
    const matchesLocation = selectedLocation === 'All' || product.location === selectedLocation;
    const matchesPrice = product.price >= priceRange[0] && product.price <= priceRange[1];
    const matchesSearch = product.name.toLowerCase().includes(searchQuery.toLowerCase()) ||
      product.description.toLowerCase().includes(searchQuery.toLowerCase());

    return matchesCategory && matchesLocation && matchesPrice && matchesSearch;
  });

  const handleMobileFiltersOpen = () => {
    setMobileFiltersOpen(true);
  };

  const handleMobileFiltersClose = () => {
    setMobileFiltersOpen(false);
  };

  return (
    <Box>
      <Container maxWidth="lg" sx={{ py: 4 }}>
        <Box sx={{ mb: 4 }}>
          <Typography variant="h4" component="h1" gutterBottom sx={{ fontWeight: 700 }}>
            Agricultural Waste Marketplace
          </Typography>
          <Typography variant="body1" color="text.secondary">
            Browse and purchase agricultural waste products from verified sellers across India
          </Typography>
        </Box>

        {/* Search and Filters */}
        <Box sx={{ mb: 4 }}>
          <Grid container spacing={2}>
            <Grid item xs={12} md={6}>
              <TextField
                fullWidth
                variant="outlined"
                placeholder="Search products..."
                value={searchQuery}
                onChange={handleSearchChange}
                InputProps={{
                  startAdornment: (
                    <InputAdornment position="start">
                      <SearchIcon />
                    </InputAdornment>
                  ),
                  endAdornment: searchQuery && (
                    <InputAdornment position="end">
                      <IconButton onClick={() => setSearchQuery('')} edge="end">
                        <IconButton />
                      </IconButton>
                    </InputAdornment>
                  ),
                }}
              />
            </Grid>
            <Grid item xs={12} md={6}>
              <Box sx={{ display: 'flex', gap: 2 }}>
                {!isMobile && (
                  <>
                    <FormControl fullWidth>
                      <InputLabel>Category</InputLabel>
                      <Select
                        value={selectedCategory}
                        onChange={handleCategoryChange}
                        label="Category"
                      >
                        {categories.map((category) => (
                          <MenuItem key={category} value={category}>
                            {category}
                          </MenuItem>
                        ))}
                      </Select>
                    </FormControl>
                    <FormControl fullWidth>
                      <InputLabel>Location</InputLabel>
                      <Select
                        value={selectedLocation}
                        onChange={handleLocationChange}
                        label="Location"
                      >
                        {locations.map((location) => (
                          <MenuItem key={location} value={location}>
                            {location}
                          </MenuItem>
                        ))}
                      </Select>
                    </FormControl>
                  </>
                )}
                {isMobile && (
                  <Button
                    variant="outlined"
                    startIcon={<FilterListIcon />}
                    onClick={handleMobileFiltersOpen}
                    fullWidth
                  >
                    Filters
                  </Button>
                )}
              </Box>
            </Grid>
          </Grid>
        </Box>

        {/* Active Filters */}
        {(selectedCategory !== 'All' || selectedLocation !== 'All' || priceRange[0] !== 800 || priceRange[1] !== 2500 || searchQuery) && (
          <Box sx={{ mb: 4 }}>
            <Typography variant="subtitle1" gutterBottom>
              Active Filters:
            </Typography>
            <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 1 }}>
              {selectedCategory !== 'All' && (
                <Chip
                  label={`Category: ${selectedCategory}`}
                  onDelete={() => setSelectedCategory('All')}
                />
              )}
              {selectedLocation !== 'All' && (
                <Chip
                  label={`Location: ${selectedLocation}`}
                  onDelete={() => setSelectedLocation('All')}
                />
              )}
              {(priceRange[0] !== 800 || priceRange[1] !== 2500) && (
                <Chip
                  label={`Price: ₹${priceRange[0]} - ₹${priceRange[1]}`}
                  onDelete={() => setPriceRange([800, 2500])}
                />
              )}
              {searchQuery && (
                <Chip
                  label={`Search: ${searchQuery}`}
                  onDelete={() => setSearchQuery('')}
                />
              )}
              <Chip
                label="Clear All"
                onClick={handleClearFilters}
                color="primary"
                variant="outlined"
              />
            </Box>
          </Box>
        )}

        {/* Price Range Slider */}
        <Box sx={{ mb: 4 }}>
          <Typography gutterBottom>Price Range (₹)</Typography>
          <Slider
            value={priceRange}
            onChange={handlePriceChange}
            valueLabelDisplay="auto"
            min={800}
            max={2500}
            step={100}
          />
        </Box>

        {/* Mobile Filters Drawer */}
        <Drawer
          anchor="right"
          open={mobileFiltersOpen}
          onClose={handleMobileFiltersClose}
        >
          <Box sx={{ width: 300, p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Filters
            </Typography>
            <List>
              <ListItem>
                <FormControl fullWidth>
                  <InputLabel>Category</InputLabel>
                  <Select
                    value={selectedCategory}
                    onChange={handleCategoryChange}
                    label="Category"
                  >
                    {categories.map((category) => (
                      <MenuItem key={category} value={category}>
                        {category}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
              </ListItem>
              <ListItem>
                <FormControl fullWidth>
                  <InputLabel>Location</InputLabel>
                  <Select
                    value={selectedLocation}
                    onChange={handleLocationChange}
                    label="Location"
                  >
                    {locations.map((location) => (
                      <MenuItem key={location} value={location}>
                        {location}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
              </ListItem>
              <ListItem>
                <Box sx={{ width: '100%' }}>
                  <Typography gutterBottom>Price Range (₹)</Typography>
                  <Slider
                    value={priceRange}
                    onChange={handlePriceChange}
                    valueLabelDisplay="auto"
                    min={800}
                    max={2500}
                    step={100}
                  />
                </Box>
              </ListItem>
            </List>
            <Box sx={{ mt: 2 }}>
              <Button
                variant="contained"
                fullWidth
                onClick={handleMobileFiltersClose}
              >
                Apply Filters
              </Button>
            </Box>
          </Box>
        </Drawer>

        {/* Products Grid */}
        {filteredProducts.length > 0 ? (
          <Grid container spacing={3}>
            {filteredProducts.map((product) => (
              <Grid item xs={12} sm={6} md={4} key={product.id}>
                <ProductCard {...product} />
              </Grid>
            ))}
          </Grid>
        ) : (
          <Box sx={{ textAlign: 'center', py: 8 }}>
            <Typography variant="h6" color="text.secondary">
              No products match your filter criteria. Please try different filters.
            </Typography>
          </Box>
        )}
      </Container>
    </Box>
  );
};

export default MarketplacePage;
